    const admin = useContext(AuthContext.Consumer)
    console.log(admin)
    // const adminID = useContext(AuthContext.Consumer)

    // const email  = useContext(AuthContext.Consumer)
    // console.log(email.email)
    // console.log(adminID.adminID)
    console.log(admin.admin)


    return (
        <Route
            {...rest}
            render={props =>
                !!admin.admin ? <Component {...props} /> : null 
            }
        />
    )
}


export default ProtectedRoute
